import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click first product's Add to Cart button
    await page.waitForSelector('.product-card .add-to-cart', { timeout: 5000 });
    await page.click('.product-card .add-to-cart:first-of-type');

    // Wait for cart update notification
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_added.png'));

    // Extract cart count and product info
    const cartCount = await page.$eval('.cart-count', el => el.textContent);
    const productTitle = await page.$eval('.product-card:first-of-type .product-title', el => el.textContent.trim());

    return {
      success: true,
      action: "Added first product to cart successfully",
      extractedData: {
        cartCount: parseInt(cartCount),
        productTitle: productTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
